import React from "react";

import Header from "../../components/organisms/Header";
import LandingLayout from "../../components/templates/LandingLayout";
import Table from "../../components/molecules/Table";

const board = () => {
  return (
    <div>
      <Header />
      <LandingLayout>
        <Table />
      </LandingLayout>
    </div>
  );
};

export default board;
